import React from "react";
import "./style.css";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import CircleIcon from "@mui/icons-material/Circle";

function Home() {
  return (
    <div className="container">
      <div className="columnHome">
        <div className="container1">
          <Card sx={{ width: "100%", height: "100%" }}>
            <CardContent
              style={{
                display: "flex",
                flexDirection: "column",
                alignSelf: "center",
                alignItems: "center",
                justifyContent: "center",
              }}
            >
              <h2>Utilizadores Online</h2>
              <h1
                style={{
                  fontSize: "50px",
                  display: "flex",
                  alignItems: "center",
                }}
              >
                <CircleIcon
                  style={{ marginRight: "100px", color: "#26ca26" }}
                />
                25 mil
              </h1>

              <p>100 mil esta semana</p>
            </CardContent>
          </Card>
        </div>
        <div className="container2">
          <h1>Ultimas transações</h1>
        </div>
      </div>
      <div className="columnHome">
        <div className="container3">
          <h1>Paises com mais transações</h1>
        </div>
        <div className="container4">Não sei</div>
      </div>
    </div>
  );
}

export default Home;
